 import api from "../services/api";

export const fetchAll = () => dispatch => {
   //FETCH ALL CONTACT
     api.get(`v1/users`)
         .then(res => {
             dispatch({
                 type: FETCH_ALL,
                 payload: res.data
             })
         })
         .catch(err => console.log(err))

   }
